import React from 'react';
import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import ListBankAccountComponent from './components/ListBankAccountComponent';
import HeaderComponent from './components/HeaderComponent';
import FooterComponent from './components/FooterComponent';
import CreateBankAccountComponent from './components/CreateBankAccountComponent';
import UpdateBankAccountComponent from './components/UpdateBankAccountComponent';
import ViewBankAccountComponent from './components/ViewBankAccountComponent';

function App() {
  return (
    <div>
        <Router>
              <HeaderComponent />
                <div className="container">
                    <Switch> 
                          <Route path = "/" exact component = {ListBankAccountComponent}></Route>
                          <Route path = "/bankAccounts" component = {ListBankAccountComponent}></Route>
                          <Route path = "/add-bank-account/:id" component = {CreateBankAccountComponent}></Route>
                          <Route path = "/view-bank-account/:id" component = {ViewBankAccountComponent}></Route>
                          <Route path = "/update-employee/:id" component = {UpdateBankAccountComponent}></Route>
                    </Switch>
                </div>
              <FooterComponent />
        </Router>
    </div>

  );
}

export default App;
